import React, { Component } from 'react'
import { style_mapping } from "../../styled";

import mainLogo from '../../../assets/logo/logo.png';

const {
    navigation: { Navbar }
} = style_mapping;

class Navigation extends Component {
  render() {
    return (
      <Navbar>
        <img  src={mainLogo} alt="logo"/>
        <MainMenu />
        <AuthMenu />
      </Navbar>
    )
  }
}

export default Navigation
